Explainer: You know, so I think that's less clear. In some ways, you know, getting back to this idea of this wake-sleep system, we have this sleep system that is kind of the counterpoint to this wake arousal system, and so the primary nucleus region is the ventral lateral pre-optic nucleus, also called VLPO, and that has particular neuron outputs that release GABA and galanin, which work in an inhibitory way on kind of the wake promoting ones. And so, it's kind of this delicate balance of these two systems that are ongoing. In your cognitive neuro-science training, right, it sounds like it's pretty specific and focused in a particular part of the brain, the cerebellum, and one thing that I'm interested in is you bring a participant into the study, have you ensured that they got a good night's sleep? Have you asked them about their sleep?
